import * as api from '../api'
// Action  Creater
export const getPosts =  ()  => async(dispatch)=>{
    try {
        const {data} = await api.fetchPosts();
        dispatch({type:'FATCH_ALLl',payload:data})
    } catch (error) {
        console.log(error)
    }
}
export const createPost = () =>{}
